import React from "react";
import Dico from "./dico";
import emojipedia from "../emojipedia";

function CreateDico(emojiDico){
  return (
    <div>
      <Dico 
      key={emojiDico[0].id}
      emoji={emojiDico[0].emoji}
      name={emojiDico[0].name}
      meaning={emojiDico[0].meaning}
      />
    </div>
  )
}

function App() {
  return {emojipedia}

}

export default App;
